0/_/+1/fastbutton?usegapi=1&fsb-service=google&size=medium&origin=http%3A%2F%2Fnewstarland.com&url=http%3A%2F%2Fnewstarland.com%2Fessential_grid%2Fvinhomes-times-city%2F&gsrc=3p&ic=1&jsh=m%3B%2F_%2Fscs%2Fapps-static%2F_%2Fjs%2Fk%3Doz.gapi.en.HUGusW2Obik.O%2Fm%3D__features__%2Fam%3DAQ%2Frt%3Dj%2Fd%3D1%2Frs%3DAGLTcCMQfcTc_uts7vlIlqUhKKWbRzGreA#_methods=onPlusOne%2C_ready%2C_close%2C_open%2C_resizeMe%2C_renderstart%2Concircled%2Cdrefresh%2Cerefresh%2Conload&id=I0_1488907975346&parent=http%3A%2F%2Fnewstarland.com&pfname=&rpctoken=12978773" data-gapiattached="true" title="+1" style="position: static; top: 0px; width: 90px; margin: 0px; border-style: none; left: 0px; visibility: visible; height: 20px;"></iframe></div></div></div></div><div class="fsb-share-linkedin fsb-hide-count" style="float: left; width: 61px; padding: 3px 0px 2px; height: 25px; overflow: hidden; margin-right: 30px;"><a href="https://www.linkedin.com/cws/share?url=http://newstarland.com/essential_grid/vinhomes-times-city/" class="socialite linkedin fsb-linkedin" data-fsb-service="linkedin" data-size="medium" data-href="http://newstarland.com/essential_grid/vinhomes-times-city/" rel="nofollow" target="_blank" style="background-image: url("http://newstarland.com/wp-content/plugins/floating-social-bar/images/fsb-sprite.png"); background-position: -347px -10px; background-size: initial; background-repeat: no-repeat; background-attachment: scroll; background-origin: initial; background-clip: initial; color: rgb(51, 51, 51); font-size: 12px; font-family: Arial, Helvetica, sans-serif; display: block; position: relative; width: 105px; height: 25px; line-height: 25px; vertical-align: middle; border: 0px !important;"><span class="fsb-count" style="width: 30px; text-align: center; display: inline-block; margin: 0px 0px 0px 70px;">0</span></a></div><div class="fsb-share-pinterest fsb-hide-count" style="float: left; width: 43px; padding: 3px 0px 2px; height: 25px; overflow: hidden; margin-right: 30px;"><a href="http://pinterest.com/pin/create/button/?url=http://newstarland.com/essential_grid/vinhomes-times-city/&description=Vinhomes+Times+City&media=http://newstarland.com/wp-content/uploads/2015/08/parkhill.jpg" class="socialite pinit fsb-pinterest" data-fsb-service="pinterest" target="_blank" rel="nofollow" style="background-image: url("http://newstarland.com/wp-content/plugins/floating-social-bar/images/fsb-sprite.png"); background-position: -484px -10px; background-size: initial; background-repeat: no-repeat; background-attachment: scroll; background-origin: initial; background-clip: initial; color: rgb(51, 51, 51); font-size: 12px; font-family: Arial, Helvetica, sans-serif; display: block; position: relative; width: 88px; height: 25px; line-height: 25px; vertical-align: middle; border: 0px !important;"><span class="fsb-count" style="width: 30px; text-align: center; display: inline-block; margin: 0px 0px 0px 50px;">0</span></a></div></div><div class="fsb-clear" style="clear: both;"></div><h2 style="font-family: Montserrat, Helvetica, Arial, sans-serif; font-weight: 700; color: rgb(51, 51, 51); margin-top: 21px; margin-bottom: 10.5px; letter-spacing: -0.5px;">Tổng quan Times City</h2><p style="margin-bottom: 10.5px; text-rendering: optimizeLegibility; font-feature-settings: ''kern'' 1; font-kerning: normal;">Dự án <span style="font-weight: 700;">Times City</span> hay còn gọi là Dự án “Thành phố sinh thái Eco City”, được xây dựng trên diện tích 37 ha nằm, phố Minh Khai ở trung tâm Thủ đô. Sự ra đời của <em>Times City</em> hứa hẹn sẽ đem đến cho người dân thủ đô một môi trường sống thân thiện với thiên nhiên,  nhiều cây xanh, không khí trong lành và thoáng đãng.</p><p style="margin-bottom: 10.5px; text-rendering: optimizeLegibility; font-feature-settings: ''kern'' 1; font-kerning: normal;">Lấy ý tưởng từ một khu đô thị hiện đại mang phong cách kiến trúc sinh thái thân thiện của Đảo Quốc Singapore, Times City là một khu phức hợp không gian sang trọng, đẳng cấp – giúp bạn và gia đình có thể yên tâm tận hưởng cuộc sống tiện nghi và thanh bình.</p><p style="margin-bottom: 10.5px; text-rendering: optimizeLegibility; font-feature-settings: ''kern'' 1; font-kerning: normal;"><a href="http://newstarland.com/wp-content/uploads/2014/10/ban-chinh.png" style="color: rgb(31, 167, 218);"><img class="aligncenter wp-image-4084" src="http://newstarland.com/wp-content/uploads/2014/10/ban-chinh.png" alt="ban chinh" width="700" height="436" srcset="http://newstarland.com/wp-content/uploads/2014/10/ban-chinh.png 1009w, http://newstarland.com/wp-content/uploads/2014/10/ban-chinh-300x187.png 300w, http://newstarland.com/wp-content/uploads/2014/10/ban-chinh-555x345.png 555w" sizes="(max-width: 700px) 100vw, 700px" style="border-radius: 2px; max-width: 100%; height: auto; display: block; margin: 5px auto;"></a></p><p style="margin-bottom: 10.5px; text-rendering: optimizeLegibility; font-feature-settings: ''kern'' 1; font-kerning: normal;"> </p><p style="margin-bottom: 10.5px; text-rendering: optimizeLegibility; font-feature-settings: ''kern'' 1; font-kerning: normal;">Times City được đầu tư xây dựng và quản lý bởi Tập đoàn Bất động sản hàng đầu Việt Nam – Vingroup. Các căn hộ Times City có sự kết hợp hài hòa và giao thoa độc đáo giữa phong cách kiến trúc Châu Âu và Châu Á , hứa hẹn sẽ trở thành một khu đô thị kiểu mẫu, nhanh chóng trở thành điểm phát triển trọng yếu của Thủ đô.</p><p style="margin-bottom: 10.5px; text-rendering: optimizeLegibility; font-feature-settings: ''kern'' 1; font-kerning: normal;"><em><span style="font-weight: 700;">Ý tưởng</span></em></p><p style="margin-bottom: 10.5px; text-rendering: optimizeLegibility; font-feature-settings: ''kern'' 1; font-kerning: normal;">Times City được thiết kế theo mô hình kiến trúc sinh thái hiện đại, một mô hình đã được áp dụng thành công ở nhiều nước trên thế giới. Times City đem lại cho cư dân một không gian sống trẻ trung, hiện đại, tươi mới và thanh bình với thật nhiều cây xanh, không khí trong lành và hồ nước rộng tươi mát cùng các tiện ích và tiện nghi tại chỗ, nhằm đáp ứng tối đa nhu cầu sống của cư dân, đồng thời góp phần tạo nên một Hà Nội trẻ trung, hiện đại và lộng lẫy.</p><h3 style="font-family: Montserrat, Helvetica, Arial, sans-serif; font-weight: 700; color: rgb(51, 51, 51); margin-top: 21px; margin-bottom: 10.5px; letter-spacing: -0.5px;">Hạ tầng – quy hoạch khu đô thị Times City</h3><p style="margin-bottom: 10.5px; text-rendering: optimizeLegibility; font-feature-settings: ''kern'' 1; font-kerning: normal;">Với tổng diện tích lên tới 364.500m2, Times City được chia thành nhiều phân khu chức năng khác nhau bao gồm: Hệ thống căn hộ hạng sang; Trung tâm thương mại cao cấp; Khu vui chơi giải trí đa dạng; Khu ẩm thực phong phú; Khu thủy cung; Sân trượt băng trong nhà; Bệnh viện quốc tế; Hệ thống trường liên cấp đạt chuẩn quốc tế; Chuỗi công viên cây xanh và hồ nước rộng. Với hệ thống trên, Times City hứa hẹn là nhân tố quan trọng, đánh thức tiềm năng, góp phần thay đổi diện mạo vùng đất phía Nam Thủ đô và đem đến cho bạn một không gian sống trẻ trung và hiện đại.</p><p style="margin-bottom: 10.5px; text-rendering: optimizeLegibility; font-feature-settings: ''kern'' 1; font-kerning: normal;"><span style="font-weight: 700;"><em>Sơ đồ mặt bằng tổng thể Times City</em></span></p><figure id="attachment_4791" class="wp-caption aligncenter" style="margin: 5px auto; max-width: 100%; height: auto; background-color: rgba(0, 0, 0, 0.0470588); padding: 5px; text-align: center; width: 700px;"><a href="http://newstarland.com/wp-content/uploads/2015/08/san-the-thao.jpg" style="color: rgb(31, 167, 218);"><img class="wp-image-4791" src="http://newstarland.com/wp-content/uploads/2015/08/san-the-thao.jpg" alt="Sân thể thao Times City" width="700" height="394" srcset="http://newstarland.com/wp-content/uploads/2015/08/san-the-thao.jpg 745w, http://newstarland.com/wp-content/uploads/2015/08/san-the-thao-300x169.jpg 300w, http://newstarland.com/wp-content/uploads/2015/08/san-the-thao-555x312.jpg 555w" sizes="(max-width: 700px) 100vw, 700px" style="border-radius: 2px; max-width: 100%; height: auto; margin: 0px; padding: 0px; width: auto;"></a><figcaption class="wp-caption-text" style="line-height: 17px; margin: 4px 5px;">Sân thể thao Times City</figcaption></figure><p style="margin-bottom: 10.5px; text-rendering: optimizeLegibility; font-feature-settings: ''kern'' 1; font-kerning: normal;"> </p><figure id="attachment_4792" class="wp-caption aligncenter" style="margin: 5px auto; max-width: 100%; height: auto; background-color: rgba(0, 0, 0, 0.0470588); padding: 5px; text-align: center; width: 700px;"><a href="http://newstarland.com/wp-content/uploads/2015/08/vinmec.jpg" style="color: rgb(31, 167, 218);"><img class="wp-image-4792" src="http://newstarland.com/wp-content/uploads/2015/08/vinmec.jpg" alt="Bệnh viên Vinmec" width="700" height="456" srcset="http://newstarland.com/wp-content/uploads/2015/08/vinmec.jpg 971w, http://newstarland.com/wp-content/uploads/2015/08/vinmec-300x195.jpg 300w, http://newstarland.com/wp-content/uploads/2015/08/vinmec-555x361.jpg 555w" sizes="(max-width: 700px) 100vw, 700px" style="border-radius: 2px; max-width: 100%; height: auto; margin: 0px; padding: 0px; width: auto;"></a><figcaption class="wp-caption-text" style="line-height: 17px; margin: 4px 5px;">Bệnh viên Vinmec</figcaption></figure><p style="margin-bottom: 10.5px; text-rendering: optimizeLegibility; font-feature-settings: ''kern'' 1; font-kerning: normal;"><em><span style="font-weight: 700;">Trung tâm mua sắm</span></em></p><p style="margin-bottom: 10.5px; text-rendering: optimizeLegibility; font-feature-settings: ''kern'' 1; font-kerning: normal;">Với sự góp mặt của rất nhiều nhãn hiệu thời trang, trang sức, mỹ phẩm, nước hoa, phụ kiện, điện máy, nội thất… nổi tiếng trong và ngoài nước, Trung tâm mua sắm tại Vincom Mega Mall – Times City hứa hẹn là khu mua sắm hiện đại và sầm uất bậc nhất tại Việt Nam.</p><figure id="attachment_4793" class="wp-caption aligncenter" style="margin: 5px auto; max-width: 100%; height: auto; background-color: rgba(0, 0, 0, 0.0470588); padding: 5px; text-align: center; width: 700px;"><a href="http://newstarland.com/wp-content/uploads/2015/08/Vincom-Mega-Mall-Times-City.jpg" style="color: rgb(31, 167, 218);"><img class="wp-image-4793" src="http://newstarland.com/wp-content/uploads/2015/08/Vincom-Mega-Mall-Times-City.jpg" alt="Vincom-Mega-Mall-Times-City" width="700" height="460" srcset="http://newstarland.com/wp-content/uploads/2015/08/Vincom-Mega-Mall-Times-City.jpg 804w, http://newstarland.com/wp-content/uploads/2015/08/Vincom-Mega-Mall-Times-City-300x197.jpg 300w, http://newstarland.com/wp-content/uploads/2015/08/Vincom-Mega-Mall-Times-City-555x364.jpg 555w" sizes="(max-width: 700px) 100vw, 700px" style="border-radius: 2px; max-width: 100%; height: auto; margin: 0px; padding: 0px; width: auto;"></a><figcaption class="wp-caption-text" style="line-height: 17px; margin: 4px 5px;">Vincom Mega Mall Times City</figcaption></figure><p style="margin-bottom: 10.5px; text-rendering: optimizeLegibility; font-feature-settings: ''kern'' 1; font-kerning: normal;"><em><span style="font-weight: 700;">Làng ẩm thực</span></em></p><p style="margin-bottom: 10.5px; text-rendering: optimizeLegibility; font-feature-settings: ''kern'' 1; font-kerning: normal;">Trong khuôn viên rộng lớn và sang trọng, Làng ẩm thực tại Vincom Mega Mall – Times City với gần 100 nhà hàng được thiết kế độc đáo, ấn tượng. Đây là địa điểm lý tưởng để bạn có thể gặp gỡ, giao lưu và thưởng thức những hương vị ẩm thực nổi tiếng khắp 4 phương.</p><p style="margin-bottom: 10.5px; text-rendering: optimizeLegibility; font-feature-settings: ''kern'' 1; font-kerning: normal;">Cũng tại đây, sau những bữa tiệc ấm cúng và vui vẻ, bạn có thể tiếp tục hành trình khám phá của mình bên những ly hoa quả thơm ngon, tách café thơm nồng hay say cùng những cốc kem tươi tuyệt vời và những ly cooktail hấp dẫn.</p><p style="margin-bottom: 10.5px; text-rendering: optimizeLegibility; font-feature-settings: ''kern'' 1; font-kerning: normal;"><em><span style="font-weight: 700;">Siêu thị tiêu dùng</span></em></p><p style="margin-bottom: 10.5px; text-rendering: optimizeLegibility; font-feature-settings: ''kern'' 1; font-kerning: normal;">Tại Times City, hệ thống siêu thị tiêu dùng thông minh được bố trí khoa học, hài hòa trong quần thể chung nhằm tạo điều kiện thuận lợi tối đa cho cư dân trong việc di chuyển, tìm kiếm và lựa chọn những mặt hàng thiết yếu cho cuộc sống hằng ngày.</p><p style="margin-bottom: 10.5px; text-rendering: optimizeLegibility; font-feature-settings: ''kern'' 1; font-kerning: normal;">Sau những giờ lao động miệt mài và nhiều áp lực, các bà nội trợ vừa có thể thảnh thơi dạo bước thư giãn trong không gian rộng rãi, thoáng mát của siêu thị vừa có thể thỏa sức lựa chọn những loại thực phẩm tươi ngon, an toàn cho bữa ăn của gia đình.</p><figure id="attachment_4794" class="wp-caption aligncenter" style="margin: 5px auto; max-width: 100%; height: auto; background-color: rgba(0, 0, 0, 0.0470588); padding: 5px; text-align: center; width: 700px;"><a href="http://newstarland.com/wp-content/uploads/2015/08/rap-chieu-phim.jpg" style="color: rgb(31, 167, 218);"><img class="wp-image-4794" src="http://newstarland.com/wp-content/uploads/2015/08/rap-chieu-phim.jpg" alt="rap-chieu-phim" width="700" height="361" srcset="http://newstarland.com/wp-content/uploads/2015/08/rap-chieu-phim.jpg 740w, http://newstarland.com/wp-content/uploads/2015/08/rap-chieu-phim-300x155.jpg 300w, http://newstarland.com/wp-content/uploads/2015/08/rap-chieu-phim-555x287.jpg 555w" sizes="(max-width: 700px) 100vw, 700px" style="border-radius: 2px; max-width: 100%; height: auto; margin: 0px; padding: 0px; width: auto;"></a><figcaption class="wp-caption-text" style="line-height: 17px; margin: 4px 5px;">Rạp Chiếu Phim</figcaption></figure><h3 style="font-family: Montserrat, Helvetica, Arial, sans-serif; font-weight: 700; color: rgb(51, 51, 51); margin-top: 21px; margin-bottom: 10.5px; letter-spacing: -0.5px;">Thiết kế – mẫu nhà</h3><p style="margin-bottom: 10.5px; text-rendering: optimizeLegibility; font-feature-settings: ''kern'' 1; font-kerning: normal;">Khu căn hộ tại Times City được thiết kế và bố trí hài hòa trong quần thể chung nhằm phát huy tối đa tiện ích của hệ thống trang thiết bị tối tân, hệ thống dịch vụ hoàn hảo nhằm đem đến cho gia đình bạn một môi trường sống lý tưởng.</p><p style="margin-bottom: 10.5px; text-rendering: optimizeLegibility; font-feature-settings: ''kern'' 1; font-kerning: normal;">Bên cạnh những tiện nghi sống hiện đại và an toàn được trang bị chung, cư dân của Times City có thể chủ động lựa chọn, lên phương án thiết kế nội thất cho căn hộ của gia đình theo đúng sở thích và yêu cầu.</p><p style="margin-bottom: 10.5px; text-rendering: optimizeLegibility; font-feature-settings: ''kern'' 1; font-kerning: normal;"><a href="http://newstarland.com/wp-content/uploads/2015/08/noi-that.jpg" style="color: rgb(31, 167, 218);"><img class="aligncenter wp-image-4795" src="http://newstarland.com/wp-content/uploads/2015/08/noi-that-1024x684.jpg" alt="noi that" width="700" height="467" srcset="http://newstarland.com/wp-content/uploads/2015/08/noi-that-1024x684.jpg 1024w, http://newstarland.com/wp-content/uploads/2015/08/noi-that-300x200.jpg 300w, http://newstarland.com/wp-content/uploads/2015/08/noi-that-360x240.jpg 360w, http://newstarland.com/wp-content/uploads/2015/08/noi-that-555x371.jpg 555w" sizes="(max-width: 700px) 100vw, 700px" style="border-radius: 2px; max-width: 100%; height: auto; display: block; margin: 5px auto;"></a></p><p style="margin-bottom: 10.5px; text-rendering: optimizeLegibility; font-feature-settings: ''kern'' 1; font-kerning: normal;"> </p><p style="margin-bottom: 10.5px; text-rendering: optimizeLegibility; font-feature-settings: ''kern'' 1; font-kerning: normal;"> </p><p style="margin-bottom: 10.5px; text-rendering: optimizeLegibility; font-feature-settings: ''kern'' 1; font-kerning: normal;">Times City được thiết kế thành nhiều tòa nhà trên nền tổng diện tích mặt bằng 364.500m2, các diện tích mặt bằng căn hộ đa dạng, đáp ứng tối đa nhu cầu về nhà ở của cư dân.</p><p style="margin-bottom: 10.5px; text-rendering: optimizeLegibility; font-feature-settings: ''kern'' 1; font-kerning: normal;">Các tòa nhà tại đây được thiết kế độc đáo, ấn tượng theo phong cách kiến trúc hiện đại của phương Tây kết hợp với cách bài trí hài hòa, tinh tế, cách sắp đặt tỉ mỉ của hệ thống trang thiết bị, nội thất, tiện nghi theo quan niệm phong thủy Á Đông, tạo nên những không gian sống hoàn hảo, lý tưởng.</p><p style="margin-bottom: 10.5px; text-rendering: optimizeLegibility; font-feature-settings: ''kern'' 1; font-kerning: normal;">Tại Times City, cư dân được trải nghiệm một cuộc sống tiện nghi, an toàn và hạnh phúc trong những không gian sang trọng, hiện đại với nội thất cao cấp được thiết kế từ đá và gỗ tự nhiên.</p><p style="margin-bottom: 10.5px; text-rendering: optimizeLegibility; font-feature-settings: ''kern'' 1; font-kerning: normal;"> </p><p style="margin-bottom: 10.5px; text-rendering: optimizeLegibility; font-feature-settings: ''kern'' 1; font-kerning: normal;">Bên cạnh chuỗi nội thất sang trọng, hiện đại, mỗi căn hộ tại Times City còn được trang bị hệ thống kiểm soát và quản lý an toàn vô cùng hiện đại và tối tân: hệ thống đèn cảm ứng, điều khiển tự động, tiết kiệm năng lượng; hệ thống chuông hình ảnh, chốt khóa điện, cổng camera, chip điện tử…, hệ thống phòng cháy chữa cháy đạt tiêu chuẩn của Hiệp hội phòng cháy quốc gia của Hoa Kỳ.</p><p style="margin-bottom: 10.5px; text-rendering: optimizeLegibility; font-feature-settings: ''kern'' 1; font-kerning: normal;">Bên cạnh những dịch vụ tiện ích tại các cụm công trình công cộng quy mô, cư dân sống trong các căn hộ tại Times City còn được thụ hưởng một hệ thống dịch vụ tiện nghi hiện đại, đẳng cấp, trang bị tại mỗi tòa nhà.</p><p style="margin-bottom: 10.5px; text-rendering: optimizeLegibility; font-feature-settings: ''kern'' 1; font-kerning: normal;"> </p><p style="margin-bottom: 10.5px; text-rendering: optimizeLegibility; font-feature-settings: ''kern'' 1; font-kerning: normal;">Nguồn nước sinh hoạt của các cư dân được cung cấp bằng hệ thống lọc nước tổng, có van lọc an toàn tại từng phân khu chức năng. Tại mỗi toà nhà đều có hệ thống chắn barie tự động lên xuống tầng hầm; sảnh và hành lang được trang bị điều hòa và thông gió theo tiêu chuẩn của các tòa nhà cao cấp trên thế giới.</p><p style="margin-bottom: 10.5px; text-rendering: optimizeLegibility; font-feature-settings: ''kern'' 1; font-kerning: normal;"><span style="font-weight: 700;">Vị trí Times City</span></p><p style="margin-bottom: 10.5px; text-rendering: optimizeLegibility; font-feature-settings: ''kern'' 1; font-kerning: normal;">Tọa lạc tại cửa ngõ chính phía Đông Nam Thủ đô Hà Nội, cách hồ Hoàn Kiếm chưa đầy 4km về phía Nam, gần cầu Vĩnh Tuy và kết nối với cửa ngõ phía tây vào trung tâm Thành phố (Ngã Tư Sở) bằng hệ thống đường cao tốc trên cao hiện đại, Times City (Số 458 Minh Khai- Hai Bà Trưng – Hà Nội) là dự án có vị trí đắc địa trong số các dự án đã, đang và sẽ được triển khai trong khu vực.</p><p style="margin-bottom: 10.5px; text-rendering: optimizeLegibility; font-feature-settings: ''kern'' 1; font-kerning: normal;">Sự xuất hiện của Times City với hàng loạt công trình tiện ích, hiện đại tựa như một luồng sinh khí mới, đánh thức tiềm năng của vùng đất phía Nam thủ đô; tạo nên diện mạo mới cho mảnh đất địa linh nhân kiệt ngàn năm.</p><p style="margin-bottom: 10.5px; text-rendering: optimizeLegibility; font-feature-settings: ''kern'' 1; font-kerning: normal;"><span style="font-weight: 700;">Chủ đầu tư</span></p><p style="margin-bottom: 10.5px; text-rendering: optimizeLegibility; font-feature-settings: ''kern'' 1; font-kerning: normal;"><span style="font-weight: 700;">Tập đoàn Vingroup</span></p><p style="margin-bottom: 10.5px; text-rendering: optimizeLegibility; font-feature-settings: ''kern'' 1; font-kerning: normal;">Địa chỉ: Việt Hưng, Long Biên, Hà Nội, Việt Nam</p><p style="margin-bottom: 10.5px; text-rendering: optimizeLegibility; font-feature-settings: ''kern'' 1; font-kerning: normal;">Điện thoại: 0439749999 | Fax: 0439748888</p><p style="margin-bottom: 10.5px; text-rendering: optimizeLegibility; font-feature-settings: ''kern'' 1; font-kerning: normal;">Website: www.vingroup.net</p><p style="margin-bottom: 10.5px; text-rendering: optimizeLegibility; font-feature-settings: ''kern'' 1; font-kerning: normal;">Email: info@vingroup.net</p><hr style="margin-top: 21px; margin-bottom: 21px;"><p style="margin-bottom: 10.5px; text-rendering: optimizeLegibility; font-feature-settings: ''kern'' 1; font-kerning: normal;">Mọi chi tiết xin vui lòng liên hệ:</p><p style="margin-bottom: 10.5px; text-rendering: optimizeLegibility; font-feature-settings: ''kern'' 1; font-kerning: normal;"><span style="font-weight: 700;">CÔNG TY TNHH PHÁT TRIỂN THƯƠNG MẠI BĐS NEWSTARLAND.</span></p><p style="margin-bottom: 10.5px; text-rendering: optimizeLegibility; font-feature-settings: ''kern'' 1; font-kerning: normal;">Địa chỉ: L2-T6, KĐT Times City, số 458 Minh Khai, Phường Vĩnh Tuy, Quận Hai Bà Trưng, Hà Nội.</p><p style="margin-bottom: 10.5px; text-rendering: optimizeLegibility; font-feature-settings: ''kern'' 1; font-kerning: normal;">Hotline: <span style="color: rgb(255, 0, 0);"><span style="font-weight: 700;">0917.032.888</span></span></p></div>', '2017-03-07 17:33:20', NULL, 'page', 'enable', '{"1":"1","2":"1","3":"0"}', '1', 'frontend', NULL, NULL, '0', NULL, NULL, 0, NULL, NULL, NULL, 0, 0),
